(236, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:50:\"How to Write a Great Website Brief + Free Template\";s:7:\"excerpt\";s:152:\"A good website design brief is paramount to a successful web design project. Make sure that your project is a success with a well-crafted design brief. \";s:7:\"created\";i:1601540958;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:120:\"https://elementor.com/blog/create-website-brief/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:34:\"Introducing Design System Features\";s:7:\"excerpt\";s:211:\"Elementor 3.0 is finally here, and it brings a whole new way to build sites. Get ready for a special 3-in-1 release that includes: Design System Features, New Theme Builder and major performance improvements.​\";s:7:\"created\";i:1601465340;s:5:\"badge\";s:11:\"New Feature\";s:3:\"url\";s:137:\"https://elementor.com/blog/elementor-3-new-professional-features/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:60:\"WordPress Troubleshooting: Common Errors and How to Fix Them\";s:7:\"excerpt\";s:157:\"Have you come across an error and are unsure how to fix it? Follow this comprehensive guide to the most common WordPress errors and learn how to fix them.​\";s:7:\"created\";i:1601378179;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:132:\"https://elementor.com/blog/troubleshooting-wordpress-errors/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:43:\"Huge Performance Improvements For Elementor\";s:7:\"excerpt\";s:131:\"Learn about the considerable Elementor 3.0 speed and performance improvements that include CSS rendering and DOM element removal.\r\n\";s:7:\"created\";i:1600965536;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/speed-up-elementor/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:35:\"How Much Do Website Designers Make?\";s:7:\"excerpt\";s:126:\"Discover how much money web designers make, and learn more about the different factors that affect web designers’ salaries. \";s:7:\"created\";i:1600935900;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/web-designer-salary/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
